import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_iphone.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_iphone.png'));

    // Wait for the search button using nth-of-type (since there are multiple .search-btn)
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length === 0) throw new Error('No search button found');
    // Click the first visible search button
    for (let btn of searchBtns) {
      if (await btn.isVisible()) {
        await btn.click();
        break;
      }
    }

    // Wait for results heading (search results or product card with iPhone)
    // Use a product card with iPhone in the title (text selector)
    await page.waitForSelector('text=/iPhone/i', { timeout: 5000 });

    // Take screenshot of results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles containing 'iPhone'
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.filter(n => /iphone/i.test(n.textContent)).map(n => n.textContent.trim())
    );

    return {
      success: true,
      action: "Searched for 'iPhone' products and verified results appeared",
      extractedData: {
        iPhoneProductTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
